[{"location":"","page":"Home","title":"Home","text":"CurrentModule = JutulDarcy","category":"page"},{"location":"#JutulDarcy","page":"Home","title":"JutulDarcy","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for JutulDarcy.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [JutulDarcy]","category":"page"},{"location":"#JutulDarcy.MIN_ACTIVE_WELL_RATE","page":"Home","title":"JutulDarcy.MIN_ACTIVE_WELL_RATE","text":"(Absolute) Minimum well rate for a well that is not disabled.\n\n\n\n\n\n","category":"constant"},{"location":"#JutulDarcy.MIN_INITIAL_WELL_RATE","page":"Home","title":"JutulDarcy.MIN_INITIAL_WELL_RATE","text":"(Absolute) Minimum initial rate for wells when controls are updated.\n\n\n\n\n\n","category":"constant"},{"location":"#JutulDarcy.CPRPreconditioner","page":"Home","title":"JutulDarcy.CPRPreconditioner","text":"Constrained pressure residual\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.DisabledControl","page":"Home","title":"JutulDarcy.DisabledControl","text":"DisabledControl()\n\nControl that disables a well. If a well is disabled, it is disconnected from the surface network and no flow occurs between the well and the top side. Mass transfer can still occur inside the well, and between the well and the reservoir.\n\nSee also ProducerControl, InjectorControl.\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.DisabledTarget","page":"Home","title":"JutulDarcy.DisabledTarget","text":"DisabledTarget(q)\n\nDisabled target used when a well is under DisabledControl() only.\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.ImmiscibleSaturation","page":"Home","title":"JutulDarcy.ImmiscibleSaturation","text":"A single saturation that represents the \"other\" phase in a three phase compositional system where two phases are predicted by an EoS\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.InjectorControl","page":"Home","title":"JutulDarcy.InjectorControl","text":"InjectorControl(target, mix, [density])\n\nWell control that specifies injection into the reservoir. target specifies the type of target and mix defines the injection mass fractions for all species in the model during injection. \n\nFor example, for a three-component system made up of CO2, H2O and H2, setting [0.1, 0.6, 0.3] would mean that the injection stream would contain 1 part CO2, 6 parts H2O and 3 parts H2 by mass. For an immiscible system (e.g. LiquidPhase(), VaporPhase()) the species corresponds to phases and [0.3, 0.7] would mean a 3 to 7 mixture of liquid and vapor by mass.\n\nThe density of the injected fluid at surface conditions is given by density which is defaulted to 1.0 if not given.\n\nSee also ProducerControl, DisabledControl.\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.MinimalTPFAGrid","page":"Home","title":"JutulDarcy.MinimalTPFAGrid","text":"MinimalTPFAGrid(ϕ, N)\n\nGenerate a minimal grid suitable only for two-point flux discretization (TPFA) for given pore-volumes ϕ and a neighborship matrix N with size (2, n) where n is the number of internal faces.\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.MixedWellSegmentFlow","page":"Home","title":"JutulDarcy.MixedWellSegmentFlow","text":"Two point approximation with flux for wells\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.Perforations","page":"Home","title":"JutulDarcy.Perforations","text":"Perforations are connections from well cells to reservoir vcells\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.PhaseMassDensities","page":"Home","title":"JutulDarcy.PhaseMassDensities","text":"Mass density of each phase\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.Pressure","page":"Home","title":"JutulDarcy.Pressure","text":"Pressure\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.ProducerControl","page":"Home","title":"JutulDarcy.ProducerControl","text":"ProducerControl(target)\n\nWell control for production out of the reservoir. target specifies the type of target (for example BottomHolePressureTarget()).\n\nSee also DisabledControl, InjectorControl.\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.SegmentWellBoreFrictionHB","page":"Home","title":"JutulDarcy.SegmentWellBoreFrictionHB","text":"Hagedorn and Brown well bore friction model for a segment.\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.SinglePhaseRateTarget","page":"Home","title":"JutulDarcy.SinglePhaseRateTarget","text":"SinglePhaseRateTarget(q, phase)\n\nSingle-phase well target with value q specified for phase.\n\nExamples\n\njulia> SinglePhaseRateTarget(0.001, LiquidPhase())\nSinglePhaseRateTarget of 0.001 [m^3/s] for LiquidPhase()\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.SurfaceGasRateTarget","page":"Home","title":"JutulDarcy.SurfaceGasRateTarget","text":"SurfaceGasRateTarget(q)\n\nWell target of specified gas rate with value q at surface conditions.\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.SurfaceLiquidRateTarget","page":"Home","title":"JutulDarcy.SurfaceLiquidRateTarget","text":"SurfaceLiquidRateTarget(q)\n\nWell target of specified liquid rate with value q (liquid/oil and water, but not gas) at surface conditions.\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.SurfaceOilRateTarget","page":"Home","title":"JutulDarcy.SurfaceOilRateTarget","text":"SurfaceOilRateTarget(q)\n\nWell target of specified oil rate with value q at surface conditions.\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.SurfaceWaterRateTarget","page":"Home","title":"JutulDarcy.SurfaceWaterRateTarget","text":"SurfaceWaterRateTarget(q)\n\nWell target of specified water rate with value q at surface conditions.\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.TabulatedRelPermSimple","page":"Home","title":"JutulDarcy.TabulatedRelPermSimple","text":"Interpolated multiphase rel. perm. that is simple (single region, no magic for more than two phases)\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.ThreePhaseRelPerm","page":"Home","title":"JutulDarcy.ThreePhaseRelPerm","text":"Interpolated multiphase rel. perm. that is simple (single region, no magic for more than two phases)\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.TotalRateTarget","page":"Home","title":"JutulDarcy.TotalRateTarget","text":"TotalRateTarget(q)\n\nWell target of specified total rate of all phases with value q at surface conditions.\n\n\n\n\n\n","category":"type"},{"location":"#JutulDarcy.half_face_two_point_flux_fused-NTuple{5, Any}","page":"Home","title":"JutulDarcy.half_face_two_point_flux_fused","text":"TPFA-SPU Mobility * KGrad(p) without gravity. (Inner version, with explicit inputs)\n\n\n\n\n\n","category":"method"},{"location":"#JutulDarcy.half_face_two_point_flux_fused-Tuple{Any, Any, Any}","page":"Home","title":"JutulDarcy.half_face_two_point_flux_fused","text":"TPFA-SPU Mobility * KGrad(p) without gravity. (Outer version, with conn_data input)\n\n\n\n\n\n","category":"method"},{"location":"#JutulDarcy.half_face_two_point_flux_fused_gravity-NTuple{4, Any}","page":"Home","title":"JutulDarcy.half_face_two_point_flux_fused_gravity","text":"TPFA-SPU Mobility * (KGrad(p) + G). (Outer version, with conn_data input)\n\n\n\n\n\n","category":"method"},{"location":"#JutulDarcy.half_face_two_point_flux_fused_gravity-NTuple{7, Any}","page":"Home","title":"JutulDarcy.half_face_two_point_flux_fused_gravity","text":"TPFA-SPU Mobility * (KGrad(p) + G). (Inner version, with explicit inputs)\n\n\n\n\n\n","category":"method"},{"location":"#JutulDarcy.half_face_two_point_kgradp-Tuple{NamedTuple, AbstractArray}","page":"Home","title":"JutulDarcy.half_face_two_point_kgradp","text":"TPFA KGrad(p) without gravity. (Outer version, with conn_data input)\n\n\n\n\n\n","category":"method"},{"location":"#JutulDarcy.half_face_two_point_kgradp-Union{Tuple{I}, Tuple{R}, Tuple{I, I, Any, AbstractArray{R}}} where {R<:Real, I<:Integer}","page":"Home","title":"JutulDarcy.half_face_two_point_kgradp","text":"TPFA KGrad(p) without gravity. (Inner version, with explicit inputs)\n\n\n\n\n\n","category":"method"},{"location":"#JutulDarcy.half_face_two_point_kgradp_gravity-Tuple{NamedTuple, Any, Any}","page":"Home","title":"JutulDarcy.half_face_two_point_kgradp_gravity","text":"Two point Darcy flux with gravity - outer version that takes in NamedTuple for static parameters\n\n\n\n\n\n","category":"method"},{"location":"#JutulDarcy.half_face_two_point_kgradp_gravity-Union{Tuple{I}, Tuple{R}, Tuple{I, I, Any, AbstractArray{R}, Any, AbstractArray{R}}} where {R<:Real, I<:Integer}","page":"Home","title":"JutulDarcy.half_face_two_point_kgradp_gravity","text":"Two point Darcy flux with gravity - inner version that takes in cells and transmissibily explicitly\n\n\n\n\n\n","category":"method"},{"location":"#JutulDarcy.replace_target","page":"Home","title":"JutulDarcy.replace_target","text":"replace_target(ctrl, new_target)\n\nCreate new well control using ctrl as a template that operates under new_target.\n\n\n\n\n\n","category":"function"},{"location":"#JutulDarcy.simulate_mrst_case-Tuple{Any}","page":"Home","title":"JutulDarcy.simulate_mrst_case","text":"simulate_mrst_case(file_name; kwarg...)\n\nSimulate a MRST case from file_name as exported by writeJutulInput in MRST.\n\nArguments\n\nfile_name::String: The path to a .mat file that is to be simulated.\nextra_outputs::Vector{Symbol} = [:Saturations]: Additional variables to output from the simulation.\nwrite_output::Bool = true: Write output (in the default JLD2 format)\noutput_path = nothing: Directory for output files. Files will be written under this directory. Defaults to the folder of file_name.\nwrite_mrst = true: Write MRST compatible output after completed simulation that can be read by readJutulOutput in MRST.\n\nAdditional input arguments are passed onto sensible subroutines.\n\n\n\n\n\n","category":"method"},{"location":"#JutulDarcy.two_phase_compositional_mass!-Tuple{Any, Any, Any, Any, Any, Any, Any, Any, Val{false}, Any}","page":"Home","title":"JutulDarcy.two_phase_compositional_mass!","text":"Update total masses for two-phase compositional\n\n\n\n\n\n","category":"method"},{"location":"#JutulDarcy.two_phase_compositional_mass!-Tuple{Any, Any, Any, Any, Any, Any, Any, Any, Val{true}, Any}","page":"Home","title":"JutulDarcy.two_phase_compositional_mass!","text":"Update total masses for two-phase compositional where another immiscible phase is present\n\n\n\n\n\n","category":"method"},{"location":"#JutulDarcy.well_target-Tuple{Any, BottomHolePressureTarget, Any, Any, Any, Any}","page":"Home","title":"JutulDarcy.well_target","text":"Well target contribution from well itself (bhp)\n\n\n\n\n\n","category":"method"},{"location":"#JutulDarcy.well_target-Tuple{Any, DisabledTarget, Any, Any, Any, Any}","page":"Home","title":"JutulDarcy.well_target","text":"Well target contribution from well itself (disabled, zero value)\n\n\n\n\n\n","category":"method"},{"location":"#JutulDarcy.well_target-Tuple{InjectorControl, JutulDarcy.SurfaceVolumeTarget, Any, Any, Any, Any}","page":"Home","title":"JutulDarcy.well_target","text":"Well target contribution from well itself (surface volume, injector)\n\n\n\n\n\n","category":"method"},{"location":"#JutulDarcy.well_target-Tuple{InjectorControl, TotalRateTarget, Any, Any, Any, Any}","page":"Home","title":"JutulDarcy.well_target","text":"Well target contribution from well itself (surface volume, injector)\n\n\n\n\n\n","category":"method"},{"location":"#JutulDarcy.well_target-Tuple{ProducerControl, JutulDarcy.SurfaceVolumeTarget, Any, Any, Any, Any}","page":"Home","title":"JutulDarcy.well_target","text":"Well target contribution from well itself (surface volume, producer)\n\n\n\n\n\n","category":"method"}]
